import React from 'react';
import axios from 'axios';

const AdicionarHospedagem = () => {
  
  const [formValue, setformValue] = React.useState({
    imagem: '',
    titulo: '',
    descricao: '',
    diaria: '',
    cidade: '',
    estado: '',
  });

  const handleSubmit = async() => {
    // store the states in the form data
    const loginFormData = new FormData();
    loginFormData.append("imagem", formValue.imagem)
    loginFormData.append("titulo", formValue.titulo)
    loginFormData.append("descricao", formValue.descricao)
    loginFormData.append("diaria", formValue.diaria)
    loginFormData.append("cidade", formValue.cidade)
    loginFormData.append("estado", formValue.estado)
  
    try {
      // make axios post request
      const response = await axios({
        method: "post",
        url: "http://localhost:4000/casas",
        data: loginFormData,
        headers: { "Content-Type": "multipart/form-data" },
      });
    } catch(error) {
      console.log(error)
    }
  }

  const handleChange = (event: any) => {
    setformValue({
      ...formValue,
      [event.target.name]: event.target.value
    });
  }

  return (
    <form onSubmit={handleSubmit}>
      <p>Formulário de hospedagem</p>
      <input
        type="text"
        name="imagem"
        placeholder="Insira o URL da imagem"
        value={formValue.imagem}
        onChange={handleChange}
      />
      <input
        type="text"
        name="titulo"
        placeholder="Insira o título da hospedagem"
        value={formValue.titulo}
        onChange={handleChange}
      />
      <input
        type="text"
        name="descricao"
        placeholder="Insira a descrição da hospedagem"
        value={formValue.descricao}
        onChange={handleChange}
      />
      <input
        type="text"
        name="diaria"
        placeholder="Insira o valor da diária em R$"
        value={formValue.diaria}
        onChange={handleChange}
      />
      <input
        type="text"
        name="cidade"
        placeholder="Insira a cidade"
        value={formValue.cidade}
        onChange={handleChange}
      />
      <input
        type="text"
        name="estado"
        placeholder="Insira o estado"
        value={formValue.estado}
        onChange={handleChange}
      />
      <button
        type="submit"
      >
        Enviar
      </button>
    </form>
  )
};

export default AdicionarHospedagem;
